import Item from "./item";

const select = ({SelectData}) => {
    return <div className="select">
        <select>
            {SelectData.map((item) => {
                const {no, name} = item;
                return (
                    <Item
                        no={no}
                        name={name}
                    />
                );
            })
            }
        </select>
    </div>
}

export default select
